import { useState } from "react";

function Dashboard() {
  const [tab, setTab] = useState("Your Trackings");

  const staticTabs = [
    "Your Trackings",
    "Crop Suggestions",
    "Predict Production",
  ];
  return (
    <div className="Dashboard">
      <section className="tabs">
        <ul className="tabs">
          {staticTabs.map((value, key) => (
            <li
              key={key}
              onClick={() => {
                setTab(value);
              }}
              value={value}
              className={tab === value ? "active" : ""}
            >
              {value}
            </li>
          ))}
        </ul>
      </section>
      <section className="right">{tab == ""}</section>
    </div>
  );
}

export default Dashboard;
